const initialState = {
    isDivVisible: false,
  };
  
  const reducer = (state = initialState, action) => {
    switch (action.type) {
      case 'TOGGLE_DIV_VISIBILITY':
        return {
          ...state,
          isDivVisible: !state.isDivVisible,
        };
      default:
        return state;
    }
  };
  
  export default reducer;
